import { Grid } from '@material-ui/core';
import SignUp from '../components/signup';

export const Register = () => {

	return (
		<Grid
			container
			spacing={0}
			direction="column"
			alignItems="center"
			justifyContent="center"
			style={{ minHeight : '100vh' }}
		>
			<Grid item xs={3} columnSpacing={{ xs : 1, sm : 2, md : 3 }} >
				<SignUp />
			</Grid>

		</Grid> 
	);
};
